    return (
        <AppProvider>
        <Router>
          <Switch>
            <Route path="/" exact>
              <Dashboard />
            </Route>
            {/* <Route path="/tags">
              <Tags />
            </Route> */}
            {/* <Route path="/item/:id" children={<Items />} exact /> */}
          </Switch>
        </Router>     
      </AppProvider>
    )
}
